Use the following C++ code to count the number of occurrences of each word in the file:
```
#include <iostream>

int main() {
    int count = 0;
    std::string line;

    std::ifstream infile;
    infile.open("data.txt");
    if (infile.is_open()) {
        for (int i = 0; i < infile.getline(cin); i++) {
            if (infile.getline(i).ends() =='') {
                // Found the word
                ++count;
            }
        }
    }
    else {
        std::cerr << "Error opening infile";
    }
    std::cout << "Count: " << ++count << std::endl;
    return 0;
}
